import React from "react";

const Navbar = Props => {
  return (
    <div className="container-fluid">
      <nav className="navbar navbar-expand-lg navbar-light bg-light">
        <p className="text-right">Total offset</p>
      </nav>
    </div>
  );
};

export default Navbar;
